        backgroundRepeat: 'no-repeat',
        backgroundSize:"cover",
        height:'100vh',
    
      
        backgroundPosition: 'center'}} className="container-fluid">
    <header>
      <h2 style={{fontSize:"40px"}} className=" rounded logo text-dark mt-3 badge badge-danger">Dimestore</h2>
    
    </header>
  
        

